- input: TEXT,F3A,,"In response to your letter dated November 9 please note that all
    aggregate contribution totals have been corrected.  The contributions from the
    LLC was divided among many partners and none of them had aggregate contributions
    above $200 for the cycle.  You have asked about the committee's best efforts methods.  The
    Committee follows all Commission guidelines for the gathering and reporting of
    best efforts.  The original solicitation contains a clear and conspicious request
    for the contributor information and includes an explaination of the law.  If the
    contributor does not provide the information a letter is sent out within 30 days
    explaining the law and asking that they complete the enclosed form and return
    it in the pre-addressed, pre-stamped envelope provided.  There is no solicitation
    included in that letter.  If the information is then provided it is filed an anamendment
    to the original report or it is included as memo entries on the next regularly
    scheduled report.  Please contact me with any further questions and thank you
    for your assistance on the phone.  "
